A Killer Within (2004)  Thriller Drama



Addison Terrill (Howell), a Dallas attorney, comes home one night to find his wife brutally murdered with the words &quot;We're even now&quot; scrawled across the bedroom wall. The cops suspect he killed her, and now ADDISON must race through the underside of Dallas to find the only other suspect. His ally is a grudging ex-cop (Esposito) who knows what it takes to deliver justice. If they can overcome their differences, they'll be able to solve the case before anyone else gets hurt.



Addison Terrill (Howell), een procureur uit Dallas, komt 's avonds thuis om daar zijn vrouw bruut vermoord aan te treffen. Alle sporen wijzen de kant van Addison uit en hij besluit dan ook te vluchten en de echte moordenaar van zijn geliefde te vinden....

